import React, { useState } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

function Account() {
  const navigate = useNavigate();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSignUp = () => {
    // 회원가입 로직을 구현하거나 API 호출을 수행할 수 있습니다.
    // 이 예제에서는 간단하게 입력된 데이터를 출력합니다.
    console.log('Email:', email);
    console.log('Password:', password);
  };

  return (
    <SidePanel>
      <Container>
        <LogoContainer> {/* 로고 컨테이너를 수정 */}
          <Logo src="/images/Ganzi1.png" alt="로고이미지" />
        </LogoContainer>
        <FormContainer>
          <Title>Create Account</Title>
          <Input
            type="Name"
            placeholder="이름"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <Input
            type="email"
            placeholder="이메일"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <Input
            type="password"
            placeholder="비밀번호"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <Button onClick={handleSignUp}>Join GanZi</Button>
        </FormContainer>
      </Container>
    </SidePanel>
  );
}

const SidePanel = styled.div`
  background-color: #B1D9DB;
  padding: 20px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100%;
`;

const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #fff;
`;

